 DROP TABLE IF EXISTS `ms_goods`;/* MySQLReback Separation */ CREATE TABLE `ms_goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '原价',
  `price1` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现金',
  `price2` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '重消积分',
  `price3` decimal(10,2) DEFAULT '0.00' COMMENT '特惠价',
  `type` smallint(1) NOT NULL COMMENT '商品类别',
  `home` smallint(1) NOT NULL COMMENT '所属分区1推荐2热销',
  `repertory` int(11) DEFAULT '0' COMMENT '库存',
  `logopath` varchar(255) DEFAULT NULL COMMENT '相册路径',
  `detailpath` varchar(255) DEFAULT NULL COMMENT '详情图片路径',
  `content` text COMMENT '描述',
  `status` smallint(1) DEFAULT '1' COMMENT '1上架2下架',
  `create_time` int(11) DEFAULT NULL COMMENT '创建时间',
  `pro_type` tinyint(1) DEFAULT NULL,
  `format` smallint(1) DEFAULT NULL,
  `children_goods` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `pv` decimal(10,2) DEFAULT '0.00',
  `shopid` int(11) DEFAULT '1',
  `shopname` varchar(255) DEFAULT NULL,
  `sale` int(11) DEFAULT '0',
  `module` smallint(1) NOT NULL DEFAULT '1' COMMENT '商品所属模块 1会员商城 2重复消费商城 3兑换商城 4商学院 5保险 6金融 ',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `is_up` tinyint(1) DEFAULT '1' COMMENT '1升级产品 2复购商品',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=414 DEFAULT CHARSET=utf8;/* MySQLReback Separation */
