 /* 插入数据 `ms_news` */
 INSERT INTO `ms_news` VALUES ('11','关于我们','<section><section><section><section><section><section><section><section><section><section><p style=\"margin-left: 48px; text-align: justify;\"><span style=\"font-size: 14px;\"><span style=\"font-family:Arial\"></span></span></p><p><span style=\"font-family:宋体\">    <strong>GHA全球健康联盟</strong>, 志在打造人居健康第一平台. 背后依托塞尔维亚国际股权数据化交易中心,新加坡旁.森林城市,广州天来宝集团科技有限公司,新天来宝集团,辣木养生谷,五大项目. 可以说是\"0\"风险.</span></p><p><span style=\"font-family:宋体\">    健康是未来世界的大趋势,GHA全球健康联盟,就是抓住机会,旨在做大做强. 让全民都参与进来,共同分享世界\"健康\"事业的一杯羹. GHA全球健康联盟,由国际化专业团队经营,五大项目作为依托背景. 让所有合伙人放心,安心.参与GHA, 就是在创业,就是在做最安稳的合伙人! </span></p><p><span style=\"font-family:宋体\">    <strong>GHA全球健康联盟,必将颠覆全球健康事业.</strong></span></p></section></section></section></section></section></section></section></section></section></section>','1','1552041954','2'),('13','联系我们','','1','1551517444','2'),('16','公司新闻','','1','1541479084','2'),('15','公司招聘','','1','1541479074','2'),('17','阳明生医正式入驻GHA!','<p>&nbsp; &nbsp; <strong>阳明生医</strong>于1997年创立第一座分子技术中心至今已超过18年,长久以来持续专精于微生物领域. 将优质的益生菌产品推广至全球各地,并致力于开发各种功能的菌株,以解决特殊疾病患者的困扰,让全世界更多的人能轻松拥抱健康!</p><p>&nbsp; &nbsp;此次阳明生医与GHA强强联合, 用更丰富多元化的合作理念让GHA的会员们得到健康保障的享受!&nbsp;</p>','1','1551765186','1');/* MySQLReback Separation */
